def get_position(freqvec, freqaxis, edge_distance):
	positions = []
	for freq_tmp in freqvec:
		positions.append(np.array([np.argmin(abs(i - freqaxis)) for i in freq_tmp * edge_distance/0.1]))
	return positions

def get_values(table, freqvec, freqaxis, angles, edge_distance):
	output = []
	for freq_tmp in freqvec:
		positions = np.array([np.argmin(abs(i - freqaxis)) for i in freq_tmp * edge_distance/0.1])
		output.append(table[(angles, positions)])
	return np.array(output) # 321*9518

def get_values2(table, positions, angles):
	output = []
	for position in positions:
		output.append(table[(angles, position)])
	return np.array(output) # 321*9518

def create_echo_single_triangles(edgeLengths, angles_mike1, angles_mike2, all_distancesTOWARDS, all_distancesbackmike1, all_distancesbackmike2):
	# calculate total reflection spectrum due to all faces
	W = Vsound/freqvec

	# f_lookup=freqvec * (av_edgeLength/0.1);

	# takethispos = np.array([np.argmin(abs(freqaxis - i)) for i in f_lookup])
	angles_mike1 = np.array([round(abs(i)) for i in angles_mike1])
	angles_mike2 = np.array([round(abs(i)) for i in angles_mike2])
	# print(angles_mike1)
	# sys.exit(1)
	
	# combloss1dB = 20*np.log10((yampl[angles_mike1,:])[:,takethispos]) # in volt as received 0.08m from face
	# combloss2dB = 20*np.log10((yampl[angles_mike2,:])[:,takethispos])

	# positions = get_position(freqvec, freqaxis, edge_distance)

	# combloss1dB = 20*np.log10(get_values(yampl, freqvec, freqaxis, angles_mike1, edgeLengths))
	# # combloss2dB = 20*np.log10(get_values(yampl, freqvec, freqaxis, angles_mike2, edgeLengths))
	# print(combloss1dB)

	takethisposs = get_position(freqvec, freqaxis, edgeLengths)
	# print(takethisposs)
	# sys.exit(1)

	combloss1dB = 20*np.log10(get_values2(yampl, takethisposs, angles_mike1))
	combloss2dB = 20*np.log10(get_values2(yampl, takethisposs, angles_mike2))

	ang_shift1 = get_values2(yphase, takethisposs, angles_mike1)
	ang_shift2 = get_values2(yphase, takethisposs, angles_mike2)
	# ang_shift1 = (yphase[angles_mike1,:])[:,takethispos]
	# ang_shift2 = (yphase[angles_mike2,:])[:,takethispos]

	# # loss calculation with distance increase
	tot_dist1 = all_distancesTOWARDS + all_distancesbackmike1  #Targetcount(:,k);    %check this is 1 way distance!!!!! Checked, correct
	tot_dist2 = all_distancesTOWARDS + all_distancesbackmike2

	tot_dist1 = ma.masked_where(tot_dist1 < 0, tot_dist1)
	tot_dist2 = ma.masked_where(tot_dist2 < 0, tot_dist2)

	tot_dist1_mat, wavele_mat_1 = np.meshgrid(tot_dist1, W)
	tot_dist2_mat, wavele_mat_2 = np.meshgrid(tot_dist2,W)

	fract_w1 = tot_dist1_mat/wavele_mat_1 # back and forth pathlength
	fract_w2 = tot_dist2_mat/wavele_mat_2 # back and forth pathlength


	phase1 = (fract_w1 % 1)*2*math.pi # add a phase shift for hard reflection (phase unchanged)
	phase1b = np.exp(-1j*(math.pi + phase1 + ang_shift1))  # phase1+ang_shift1=0

	phase2 = (fract_w2 % 1)*2*math.pi # add a phase shift for hard reflection (phase unchanged)
	phase2b = np.exp(-1j*(math.pi + phase2 + ang_shift2));

	# total spherical loss; it must be 2-way because the targets are spread so
	# uncoming amplitude will be unequal between targets
	loss1=2*6.02*np.log2(0.08/(tot_dist1/2)); # in dB relative to 8cm in front of emitter
	loss2=2*6.02*np.log2(0.08/(tot_dist2/2)); # in dB relative to 8cm in front of emitter
	# altere d summation due to phase misalignment, phase assumed identical at reflection

	# sum losses due to distance and angle:
	Ldir_path1 = loss1 + combloss1dB
	Ldir_path2 = loss2 + combloss2dB

	# Calculate phase of each arriving ray:
	array1 = np.zeros((len(tot_dist1),1)) + Em_level
	array2 = np.zeros((len(tot_dist2),1)) + Em_level
	returns1 = phase1b * array1.T
	returns2 = phase2b * array2.T

	# Convert all losses in dB into Pascal (emission is 1 Pa)
	outvolt1 = returns1 * (10**(Ldir_path1/20)) #.*beam_corr;%.*HRTF_corr1;
	outvolt2 = returns2 * (10**(Ldir_path2/20)) #.*beam_corr;%.*HRTF_corr2;

	# Sum the pressures, each with appriopriate phase:
	strength_ear1 = np.nansum(outvolt1, 1)
	strength_ear2 = np.nansum(outvolt2, 1)

	n2 = 4096
	Powerleft = np.zeros(n2, dtype = "complex_")
	Powerright = np.zeros(n2, dtype = "complex_")
	
	if len(freqvec) == len(strength_ear1):
		indexes = [int(i-1) for i in freqvec/step_size]
		Powerleft[indexes] = strength_ear1
		Powerright[indexes] = strength_ear2
	else:
		print('the length of freqvec and strength is not equal')
		sys.exit(1)

	H_left  = np.flipud(np.conj(Powerleft[1:n2]));
	H_right = np.flipud(np.conj(Powerright[1:n2]));

	# spectrum impulse response
	W3_left = np.hstack((Powerleft, [0+0j], H_left))
	W3_right = np.hstack((Powerright, [0+0j], H_right))

	w3_left = np.real(np.array([np.fft.ifft(W3_left, n=len(W3_left))]).T)
	w3_right = np.real(np.array([np.fft.ifft(W3_right, n=len(W3_right))]).T)

	return W3_left, W3_right, w3_left, w3_right


def fancy_amplitude_envelope(signal, frame_size, hop_length):
	"""Fancier Python code to calculate the amplitude envelope of a signal with a given frame size."""
	return np.array([max(signal[i:i+frame_size]) for i in range(0, len(signal), hop_length)])




